// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./SoulMarket.sol";
import "./interfaces/ISoulAuction.sol";

import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";

contract SoulAuction is SoulMarket, ISoulAuction {
    using SafeMathUpgradeable for uint256;

    event AuctionStarted(uint256 soulId, uint256 price);

    mapping(uint256 => Auction) private _onAuction;
    address public _pieAddress;
    uint256 private _freezeTime; // freeze time
    uint256 private _auctionTime;
    uint256 private _servicePiece; // 666 * 1000 * 1000 * 1000
    uint256 private _ownerPiece; // 10 * 1000 * 1000 * 1000 * 1000;
    uint256 private _minPrice; // 100000000000000

    function firstSale(uint256 soulId, uint256 price) public {
        require(carrierOf(soulId) == tx.origin);
        require(ownerOf(soulId) == tx.origin);
        require(_onAuction[soulId].isActive == false);

        _onAuction[soulId] = Auction(
            ownerOf(soulId),
            carrierOf(soulId),
            block.timestamp,
            _freezeTime,
            _auctionTime,
            price,
            price,
            true
        );

        emit AuctionStarted(soulId, price);
    }

    function bid(uint256 soulId) public payable {
        require(_exists(soulId), "Soul doesn't exists");
        require(_onAuction[soulId].isActive == true, "Not for sale");
        require(balanceOf(tx.origin) != 0, "You should have a soul!");
        // _ownershipTime

        uint256 newPrice =
            _getActualPrice(soulId) + _minPrice + _ownerPiece + _servicePiece;

        require(newPrice >= msg.value, "not enough money");

        (address owner, address carrier) = _profitFor(soulId);

        uint256 toCarrier = msg.value - _ownerPiece - _servicePiece;
        uint256 toOwner = toCarrier - _servicePiece;
        uint256 toService = toCarrier - toOwner;

        payable(carrier).transfer(toCarrier);
        payable(owner).transfer(toOwner);
        payable(_pieAddress).transfer(toService);
        setNewPrice(soulId, toCarrier + toOwner + toService);
        _changeCarrier(soulId, msg.sender);
    }

    function _reclaimSoul(uint256 soulId) internal {
        require(carrierOf(soulId) == msg.sender);
        // fee
        _onAuction[soulId].isActive = false;
    }

    function _returnSoulToAuction(uint256 soulId) internal {
        require(_exists(soulId));
        require(carrierOf(soulId) == msg.sender);
        require(_onAuction[soulId].isActive = false);
        _onAuction[soulId].isActive = true;
    }

    function auctionInfo(uint256 soulId) public view returns (Auction memory) {
        require(_exists(soulId));
        Auction memory auction = _onAuction[soulId];
        auction.actualPrice = _getActualPrice(soulId);

        return auction;
    }

    // for test
    function getCurrentPrice(uint256 soulId) public view returns (uint256) {
        return _onAuction[soulId].actualPrice;
    }

    function _getActualPrice(uint256 soulId) internal view returns (uint256) {
        Auction memory auction = _onAuction[soulId];
        uint256 timeGap = block.timestamp.sub(auction.startedAt);
        // require(timeGap > auction.duration, "Auction is over");
        // add upprice for nods and donors

        uint256 price;

        if (_timeIsOver(soulId)) {
            price = _minPrice;
        } else {
            price = auction.actualPrice.sub(timeGap);
        }

        return price;
    }

    function _timeIsOver(uint256 soulId) internal view returns (bool) {
        Auction memory auction = _onAuction[soulId];
        uint256 timeGap = block.timestamp.sub(auction.startedAt);
        if (timeGap > auction.duration) {
            return true;
        } else {
            return false;
        }
    }

    function _updateAuction(uint256 soulId) internal {}

    function _setPieAddress(address pieToken) internal onlyAdmin {
        _pieAddress = pieToken;
    }

    function _setDuration(uint256 auctionTime) internal onlyAdmin {
        _auctionTime = auctionTime;
    }

    function _setMinPrice(uint256 minPrice) internal onlyAdmin {
        _minPrice = minPrice;
    }

    function setNewPrice(uint256 soulId, uint256 newPrice) private {
        _onAuction[soulId].actualPrice = newPrice;
    }

    function _setServicePiece(uint256 piece) internal onlyAdmin {
        _servicePiece = piece;
    }

    function _setOwnerPiece(uint256 piece) internal onlyAdmin {
        _ownerPiece = piece;
    }

    // receive() external payable {
    //     payable(_pieAddress).transfer(msg.value);
    // }

    // fallback() external payable {
    //     payable(_pieAddress).transfer(msg.value);
    // }
}
